import React from "react";

const Projects = ({ data }) => {
  if (data) {
    const projects = data.map((project)=>{
      return (
        <h1>{project.title}</h1>
      )
    })
  }

  return (
    <section id="projects">
      {projects}
    </section>
  );
};

export default Projects;
